import React from 'react';

const LinkToggle = props => (
    <div onClick={props.click} 
             style={{position:"fixed",
                     top:"5%",
                     left:"10%", 
                     textAlign:"center",
                     fontSize:"28px",
                     border:"solid #ffa812 4px",
                     width:"10%"
                     }}> X
    </div>
);

export default LinkToggle
